Teams qualified for the knockout stages were ranked by their overall performance and received between 32 points (World Cup winner) and 17 points (the losing quarter finalist with the worst overall performance). ; Teams eliminated in the group stage were ranked by their performance. To calculate the seeding for the 2002 FIFA World Cup, FIFA used the FIFA World Rankings in combination with performances of national teams in the three previous World Cups.
